export const problemType = ({problemType: problemTypeA}, {problemType: problemTypeB}) => {
  if (problemTypeA > problemTypeB) {return -1; }
  return 0;
}

export const subject = ({subject: subjectA}, {subject: subjectB}) => {
  if (subjectA > subjectB) {return -1; }
  return 0;
}

export const problems = ({problems: problemsA}, {problems: problemsB}) => {
  if (problemsA > problemsB) {return -1; }
  return 0;
}

export const difficulty = ({difficulty: difficultyA}, {difficulty: difficultyB}) => {
  if (difficultyA > difficultyB) {return -1; }
  return 0;
}

export const name = ({worksheetName: worksheetNameA}, {worksheetName: worksheetNameB}) => {
  if (worksheetNameA > worksheetNameB) {return -1; }
  return 0;
}

export const source = ({worksheetSource: sourceA}, {worksheetSource: sourceB}) => {
  if (sourceA > sourceB) {return -1; }
  return 0;
}

export const timeEstimate = ({timeEstimate: timeEstimateA}, {timeEstimate: timeEstimateB}) => {
  if (timeEstimateA > timeEstimateB) {return -1; }
  return 0;
}
